import React, { useEffect } from 'react'
import BreadCrumb from '../../../components/breadcrumbs/breadCrumb'
import EnterButtons from '../../../components/enterButtons/EnterButtons'

function CJSLanding() {
  // สร้าง grid 6x6 โดยใช้ array จาก 1 ถึง 36
  const gridItems = Array.from({ length: 36 }, (_, index) => ({
    id: index + 1,
    color: index % 2 === 0 ? 'bg-blue-500' : 'bg-yellow-500', // สลับสี
  }));

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100">
      <div className="w-full">
        <BreadCrumb />
      </div>

      <div className="flex-grow flex flex-col items-center justify-center gap-4">
        {/* Grid 6x6 */}
        <div className="grid grid-cols-6 gap-4">
          {gridItems.map((item) => (
            <div
              key={item.id}
              className={`w-16 h-16 sm:w-20 sm:h-20 ${item.color} rounded-lg`}
            ></div>
          ))}
        </div>

        {/* ปุ่มเริ่มเกม */}
        <div className="mt-8">
          <EnterButtons />
        </div>
      </div>
    </div>
  );
}

export default CJSLanding;
